import React from "react";
import "./Navbar.css";

class Navbar extends React.Component {
    render () {
        return (
            <nav className="navbar">
                <ul id="navlist">
                    <li id="first"><a href="#">Option1</a></li>
                    <li id="second"><a href="#">Option2</a></li>
                    <li id="third"><a href="#">Option3</a></li>
                    <li id="last"><a href="#">Option4</a></li>
                </ul>
            </nav>
        )
    }
}

export default Navbar;
